Verenigde Staten
Horror
81 minuten

goed

met Ruta Gedmintas, Joshua Bowman en Courtney Hope

Amber droomt ervan het kleine stadje waar ze woont te verlaten, en haar vrienden helpen haar met het zoeken naar een 
appartement in de grote stad. Als hun auto het begeeft, krijgen ze een lift aangeboden, die ze dankbaar accepteren. Maar dan 
weigert de bestuurder te stoppen en ontdekken ze dat hij bloed transporteert. Hierdoor slaat de paniek snel toe. Dan stopt de 
vrachtwagen, en komen de vrienden erachter dat ze zich in een donker pakhuis bevinden. Hier worden ze opgejaagd door een groep 
wezens, die moeten leren jagen op mensen.
